import styled from 'styled-components';

const Container = styled.div`
  display:flex;
  flex-direction:column;
`;

const Header = styled.div`
  display:flex;
  flex-direction:row;
  background-color:black;
  color:white;
  padding:10px;
  font-size:25px;
  font-weight:bold;
  box-shadow:0 3px 6px 0 #555;
`;

const AppName= styled.div`
  dislay:flex;
  flex-direction:row;
  align-items:center;
`;

function App() {
  return (
    <div className="App">
      <Container>
        <Header>
          <Appname>React Movie App</Appname>
        </Header>
        Movie App</Container>
    </div>
  );
}

export default App;
